#include "checksum.h"

#include <iostream>
#include <cassert>

int main(){
	std::string teststr = "";
	std::string checksum = createChecksum(teststr);
	std::cout << "test "  << "checksum: " <<checksum<< std::endl;
	std::cout << "valid: " << checkChecksum(checksum,teststr) << " should be 1" <<std::endl;
	assert(checkChecksum(checksum,teststr)==1);

	teststr[100]='a';
	std::cout << "test "  << "checksum: " <<checksum<< std::endl;
	std::cout << "valid: " << checkChecksum(checksum,teststr) << " should be 0" <<std::endl;
	assert(checkChecksum(checksum,teststr)==0);

	checksum = createChecksum(teststr);
	std::cout << "test "  << "checksum: " <<checksum<< std::endl;
	std::cout << "valid: " << checkChecksum(checksum,teststr) << " should be 1" <<std::endl;
	assert(checkChecksum(checksum,teststr)==1);

	checksum[0]='z';
	std::cout << "test "  << "checksum: " <<checksum<< std::endl;
	std::cout << "valid: " << checkChecksum(checksum,teststr) << " should be 0" <<std::endl;
	assert(checkChecksum(checksum,teststr)==0);
}
